import ChatList from '../ChatListFolder/ChatList';
import { Link, Route, Routes } from 'react-router-dom';

function ChatParent(){
    return(
        <div>
            <ChatHeader />
          <div className="AppGrid">
            <ChatProfile />
            <Link to="me"><ChatList/></Link>
            {/*<ChatBody />*/}


            <Routes>
              <Route path="me" element={<ChatBody />} />
            </Routes>







          </div>
          
        </div>
    )
}

export default ChatParent;
